import React, {Component} from 'react';
import foto from  '../imatges/fotoFiltres.jpg';
import '../Cerca.css';
import { Link } from 'react-router-dom';

class Cerca extends Component{

    constructor(props){
        super(props);

        this.state = {
            dataInici: '',
            dataFi: ''
        };

        this.handleChangeInput = this.handleChangeInput.bind(this);

      }

      handleChangeInput(event){
        this.setState({[evt.target.name]: event.target.value});
      }

    render() {
      return (
        <div>
            <div id="cercaInici" style={{ backgroundImage: "url("+foto+")", backgroundPosition: "center", backgroundRepeat: "no-repeat"}}>
            <div className="container cercar">
                <div className="row rwcercar col-8 offset-2">

                        <input type="date" id="dataInici" name="dataInici" placeholder="Data Inici" className="form-control col-md-5" />
                        <input type="date" id="dataFi" name="dataFi" placeholder="Data Fi" className="form-control col-md-5" />

                        <Link to={"/AppCerca?dataInici="+this.state.dataInici+"&dataFi="+this.state.dataFi}>
                            <button className="btn btn-primary col-md-2"> Cerca </button>
                        </Link>
                </div>
            </div>
            </div>
        </div>
      );
    }
}

export default Cerca;
